import React from 'react';
import Signup from "./Signup"
import {AuthProvider} from '../contexts/AuthContext'
import {BrowserRouter as Router,Switch, Route} from 'react-router-dom'

function App() {
  return (

	  	<div>
	  		<Router>
	  			<AuthProvider>
	  				<Switch>
	  					<Route path='/signup' component={Signup}/>
	  				</Switch>
	  			</AuthProvider>
	  		</Router>
	  		<Signup />
	  	</div>

  	);
}

export default App;
